Diagnosis. Male palpal femur with very small bump (
Fig. 7
), embolus thin and pointed, dagger-like, accompanied by membranous pars pendula (
Fig. 8
), epigynal scape single, very long (
Figs 16–17
).

Description. Male holotype (
Figs 1–10
). Cephalothorax dark brown with two darker spots on eye field and with PLE on black surroundings. White hairs scarce, more numerous from fovea forwards; darker and longer bristles above anterior eyes. Abdomen dark grey, with slightly lighter pattern of chevrons and with terminal light grey tuft of hairs. Spinnerets dark grey, not distinctive. Chelicerae brown, distally lighter (
Fig. 5
). Maxillae, labium and sternum brown-grey, the latter with darker margins (
Fig. 2
). Venter brownish-grey, sides with dark and lighter lines. First legs dirty-brownish, darker around joints; other legs lighter, especially in proximal parts of segments. Leg formula: 4 - 1-3 - 2 . Palpal organ as illustrated in
Figs 6–10
. Dimensions: CL 1.44 , CW 1.02 , CH 0.49 , AL 1.58 , AW 0.99 , AEW 0.81 , PEW 0.74 , EFL 0.56 , ClypH 0.01 , DAM 0.23 , L 1 2.31 ( 0.70 + 0.45 + 0.51 + 0.38 + 0.27 ), L 2 1.87 ( 0.58 + 0.35 + 0.38 + 0.31 + 0.25 ), L 3 1.92 ( 0.57 + 0.29 + 0.39 + 0.41 + 0.26 ), L 4 2.50 ( 0.79 + 0.35 + 0.59 + 0.49 + 0.28 ).

Female paratype (
Figs 11–18
). Colouration and structure of dorsum very similar to the male. Chelicerae, maxillae and labium pale brownish (
Fig. 15
). Sternum dirty-grey. Venter beige-grey (
Fig. 12
). Legs dirty-grey with pale rings. Leg formula: 4 - 1-3 - 2 . Epigyne as in
Figs 16–18
. Dimensions: CL 1.55 , CW 1.02 , CH 0.48 , AL 1.90 AW 1.05 , AEW 0.87 , PEW 0.81 , EFL 0.63 , ClypH 0.01 , DAM 0.28 , L 1 2.38 ( 0.77 + 0.46 + 0.52 + 0.38 + 0.25 ), L 2 2.10 ( 0.66 + 0.41 + 0.45 + 0.34 + 0.24 ), L 3 2.25 ( 0.68 + 0.35 + 0.46 + 0.50 + 0.26 ), L 4 3.06 ( 0.94 + 0.44 + 0.75 + 0.60 + 0.33 ).
